import React from 'react'
import { Link } from 'react-router-dom'

export default function Menu() {
  return (
    <div>
        <Link className="" to={'/about'}>ABOUT</Link>
        <Link to={'/gallery'}>GALLERY</Link>
        <Link to={'/music'}>MUSIC</Link>
    </div>
  )
}
